import Header from './Header';
import { inherits } from 'util';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const navbarCollapse = {
  display: inherits,
  // height: auto,
  margin: 20,
  padding: 20,
  border: '1px solid #DDD',
  // overflow: visible
};
export default function Layout(props) {
return (
    <div style={navbarCollapse}>
      <Header />
      {props.children}
    </div>
  );
}
